   "source": [
    "## 5.2 Steps and Minutes aspleep per weekday\n",
    "We want to know now what days of the week are the users more active and also what days of the week users sleep more. We will also verify if the users walk the recommended amount of steps and have the recommended amount of sleep.\n",
    "\n",
    "Below we are calculating the weekdays based on our column date. We are also calculating the average steps walked and minutes sleeped by weekday."
   ]
