    "grid.arrange(\n",
    "    ggplot(weekday_steps_sleep) +\n",
    "      geom_col(aes(weekday, daily_steps), fill = \"light blue\") +\n",
    "      geom_hline(yintercept = 7500) +\n",
    "      labs(title = \"Daily steps per weekday\", x = \"\", y = \"\", size = 20) +\n",
    "      theme(axis.text.x = element_text(angle = 45,vjust = 0.5, hjust = 1,size = 10)),\n",
    "\n",
    "    ggplot(weekday_steps_sleep, aes(weekday, daily_sleep)) +\n",
    "      geom_col(aes(weekday, dailysleep),fill = \"light pink\") +\n",
    "      geom_hline(yintercept = 480) +\n",
    "      labs(title = \"Minutes asleep per weekday\", x = \"\",y = \"\", size = 20) +\n",
    "      theme(axis.text.x = element_text(angle = 45,vjust = 0.5, hjust = 1,size = 10)),\n",
    "    ncol = 2\n",
    "    )\n",
    "\n"
