    "# 6. Conclusion (Act Phase)\n",
    "\n",
    "6. Conclusion (Act Phase) \n",
    "Bellabeat's mission is to empower women by providing them with the data to discover themselves.\n",
    "\n",
    "In order for us to respond to our business task and help Bellabeat on their mission, based on our results, I would advice to use own tracking data for further analysis. Datasets used have a small sample and can be biased since we didn't have any demographic details of users. Knowing that our main target are young and adult women I would encourage to continue finding trends to be able to create a marketing stragety focused on them.\n",
    "\n",
    "That being said, after our analysis we have found different trends that may help our online campaign and improve Bellabeat app:\n",
    "\n",
    "\n",
    "1. **Daily notification on steps and posts on app** : \n",
    "\n",
    "We classified users into 4 categories and saw that the average of users walk more than 7,500 steps daily besides Sundays. We can encourage customers to reach at least daily recommended steps by CDC - 8.000 sending them alarms if they haven't reached the steps and creating also posts on our app explaining the benefits of reaching that goal. As CDC explains the more steps you walk the lower is the mortality rate. We also saw a positive correlation between steps and calories.\n",
    "\n",
    "2. **Notification and sleep techniques** : \n",
    "\n",
    "Based on our results we can see that users sleep less than 8 hours a day. They could set up a desired time to go to sleep and receive a notification minutes before to prepare to sleep. Also offer helpfull resources to help customers sleep - ex. breathing advises, podcasts with relaxing music, sleep techniques.\n",
    "\n",
    "3. **Reward system** : \n",
    "\n",
    "We are aware that some people don't get motivated by notifications so we could create a kind of game on our app for a limited period of time. Game would consist in reaching different levels based on amount of steps walked every day. You need to maintain activity level for a period of time (maybe a month) to pass to the next level. For each level you would win certain amount of stars that would be redeemable for merchandise or discount on other Bellabeat products.\n",
    "\n",
    "4. **Advertisement** :\n",
    "\n",
    "We can create an advertisement where we can show working women wearing our products while doing everyday work and chores which can showcase our products versatility and durability and help increase it's everyday usage by emphasizing on points such as : \n",
    "* Water resistance.\n",
    "* Long battery life."
   ]
